(95, 0, 0, 32, 'GAME_ACTION', 0, 'Action', '8/2014', 'Phiên bản tai game kim cuong mien phi dành cho điện thoại vẫn giữ nguyên những tính năng như bản chơi online. Trong game bạn vẫn phải tìm cách sắp xếp để có được 3 viên kim cương trở lên đồng màu và ăn điểm.Cách chơi:- Click trên hai hoặc nhiều kim cương cùng loại để phá hủy chúng;- Đạt được Điểm mục tiêu của mỗi cấp độ để có thể chuyển qua cấp độ cao hơn.- Cố gắng sử dụng bom, sét liên kết nhiều kim cương 1 lúc để được nhiều điểm. Điểm sẽ tăng rất lớn.- Cố gắng phá hết kim cương để nhận điểm thưởng nếu số Kim Cương còn lại ítSức mạnh:- Bom: để phá hủy một viên ngọc duy nhất;- Sét: Để phá hủy tất cả đồ trang sức của cùng một cột. Version natural diamonds mien phi game for your phone remains the same features as the online play. In the game you still have to find arrangements to get 3 or more diamonds and eating the same color.How to play:- Click on two or more diamonds of the same type to destroy them;- Achieve The goal of each level to be able to move through the higher levels.- Try to use the bomb, many diamond lightning links 1 time to get more points. Points will increase greatly.- Try to break all diamond to receive bonus points if the remaining diamond atStrength:- Bomb: to destroy a single pearl;- Clay: To destroy all jewels of the same column.', '100,000 - 500,000', 0, '2017-07-06', 'com.cuchuoi.gamevui', 4, '//lh6.ggpht.com/w4gEMIMKv83hwRL9vn7pxHZ3LUPdF5YHFTYzUgQ6CFTYum69X12Y-jLNEW6yxuiBFw=h310#//lh6.ggpht.com/A-sHyYodcb-EwaeB_dSUN0INHXFZMuHZr3ZhcwPC3iK35Qcmi7CTExQPRcvZ5frQAVI=h310#//lh6.ggpht.com/qaAh8p59vnUaVZMLoEEZwBiWk2ki8DOP8vAn03m9ihpJoxoeM9Ltu5x35fEIUar5NfoA=h310#//lh5.ggpht.com/1T-CX70HJZXgc4KU4Ffdc1Y22Kl-H_ztLqQbure2DFeqPSgFCPLSPk-fCNe_TSZ-5YE=h310#//lh4.ggpht.com/3FzbU4B35PmzQXyugXzmVBvhuvukINm45SWDYfpiUiHRwOb77uLH-1c97fxwBvYnSxnY=h310#//lh3.ggpht.com/kxWYG3f5Xpeh4PqwmFV4VuGpblS9ITWMGLKhyIJXFTmI1m_-GdhO2Vk8c5icKpan_jE=h310#//lh3.ggpht.com/yCeyv-3QK7H9WwsMHVTVtWRlwynmmNCuUK0PBI_Owg7rbFuH6fLCVq2_