(97, 0, 0, 34, 'GAME_BOARD', 0, 'Board', '15/2015', 'Chinese chess plus game, resembling chess, played on a board consisting of two halves, each eight squares by four, with a strip separating them: pieces representing the military of ancient China are placed on the intersections of the lines and the game is won when a general is checkmatedRules1. Red moves first.2. The game is won by either checkmating or stalemating the enemy General.3. You cannot perpetual check. For example you cannot check the opponent more than 3 times in a row with the same piece or the same board position.4. You cannot force an enemy piece to move perpetually between two points to avoid capture.  If this occurs then the person attacking must withdraw the attack.5. The game is a draw when neither side can force either checkmate or stalemate.', '50 - 100', 2, '2017-10-13', 'com.chess.chinesechessplus', 4.5, '//lh3.googleusercontent.com/EOoKQ72GJUv-BkLZ8NsFSbr_TEQB3yWVmtC015bmwvgQJacmLg2YLcQNzZGgI2wKeG8=h310#//lh3.googleusercontent.com/iV4_ZuiCcRSeAsugZV1uIt49qUu8AMKcebPMsglThs6_X9AWkwrLIGf_pyR93_1BHVY=h310#//lh3.googleusercontent.com/WxQIy7-8trW8RSk1kdzCTnaBW--EDoOSMmLHXjugnqFj7mt1fNdiXmXwEFd3ujSN5MLs=h310#//lh3.googleusercontent.com/2_sCpVNgr8J33FBC9erFn8UOv-lfdrYDynQWeZjpEsIRvPI2pw3W2HpshFh4P-7k6g=h310##', '4567000', 'Cờ tướng Siêu Khó (Chinese Chess plus)', 'chinese chess plus', '1.0', '0', 'Aplication ryan', '//lh3.googleusercontent.com/2dEGKoH8UZmTBp5muiY3YS_t_eNmFN2FAq3fKynSLMxW-sgqp38frFGTRb-7y4D9R0Kz=w300', 'market://details?id=com.chess.chinesechessplus', NULL, '', 0, 0),
