(265, 0, 0, 2, 'BOOKS_AND_REFERENCE', 0, 'Books & Reference', '17/2017', ' Flume is a standard, simple, robust, flexible, and extensible tool for data ingestion from various data producers (webservers) into Hadoop. In this tutorial, we will be using simple and illustrative example to explain the basics of Apache Flume and how to use it in practice.AudienceThis tutorial is meant for all those professionals who would like to learn the process of transferring log and streaming data from various webservers to HDFS or HBase using Apache Flume.PrerequisitesTo make the most of this tutorial, you should have a good understanding of the basics of Hadoop and HDFS commands.   ', '', 1, '7/2017', 'com.freeappviet.apache.flume', 4.4, '//lh3.googleusercontent.com/PXIGJ2Ns4ijg3UgyJ2U0_BoGW19BwyRh9Gtt1jQzWauKPnNg8YRDVdDaUUdaKNuWEA=h310#//lh3.googleusercontent.com/BC6fm0CmGvBrIGb_tX34olQMGH3zhEyKT1x5d-kQf4WWMzyKF8ulUnKqEEv2Ns1JfQ=h310#//lh3.googleusercontent.com/X5N3qWg0nB_0mcGC9iEbGJ87tqjmtMpvMvzCwnsQwOVWzrUu2agWRU4Ur73_V0vwJwwI=h310#//lh3.googleusercontent.com/4ze5kENUaBztrMRhoVLwaX11dg7qxzsIk00DUR8EygkqjzejcF4uWIJVu3ZQGJzJ8Ws=h310#//lh3.googleusercontent.com/XGgBD9nQ8gsK4aJzFsQ-JUb4dTa9CNtClzr88vf7J3SVjmyOowy1kI2vPv-OdCm7irU=h310##', '4139767', 'Learn Apache Flume', 'learn apache flume', '1.0.1.1', '0', 'free.appviet', '//lh3.googleusercontent.com/sfmOvuMTTf5n7adZMKtNBI0605asAz95lVT0cX3yPg0icvA4zDfRRRB-bMl70M77UZQh=w300', 'market://details?id=com.freeappviet.apache.flume', NULL, '', 0, 0);
