(271, 0, 0, 2, 'BOOKS_AND_REFERENCE', 0, 'Books & Reference', '17/2017', ' Apache Tajo is an open-source distributed data warehouse framework for Hadoop. Tajo was initially started by Gruter, a Hadoop-based infrastructure company in south Korea. Later, experts from Intel, Etsy, NASA, Cloudera, Hortonworks also contributed to the project. Tajo refers to an ostrich in Korean language. In the year March 2014, Tajo was granted a top-level open source Apache project. This tutorial will explore the basics of Tajo and moving on, it will explain cluster setup, Tajo shell, SQL queries, integration with other big data technologies and finally conclude with some examples.AudienceBefore proceeding with this tutorial, you must have a sound knowledge on core Java, any of the Linux OS, and DBMS.PrerequisitesThis tutorial has been prepared for professionals aspiring to make a career in big data analytics. This tutorial will give you enough understanding on Apache Tajo.   ', '', 1, '7/2017', 'com.freeappviet.apache.tajo', 4.1, '//lh3.googleusercontent.com/T3CEM2w3nN_9WxI9h4ILuZ3F320W162qU2pReuqISJeswatFp6sNdFofikZA6D2ht5w=h310#//lh3.googleusercontent.com/N3AAhBwDQYBg0fOoyMQn9C0TfTC5LgjOWIs0Xm7OQXOx6Q66d7omYZgiyVaICF95tH2o=h310#//lh3.googleusercontent.com/_pSWR58_VhxdUPaDaMahvQ3slMnqM6PjMdAeBoTOwCL9Loc770LAo4aeZW2baaTqOATu=h310#//lh3.googleusercontent.com/F1f7eptgnc-NC4gWkqCs-iVRCpdNy4Nr21q866g4yMGAsbUKcz1kp09MJtvlrBo-5w=h310#//lh3.googleusercontent.com/ACt6RRy7LSsy6Pchc4gdBKKnTSjarL6rsUbjTMoibrl4htTKSKT6cuSL2pce04333w=h310##', '3587430', 'Learn Apache Tajo', 'learn apache tajo', '1.0.1.1', '0', 'free.appviet', '//lh3.googleusercontent.com/NrWi6OrEeMNOOpo500R82MPtc4h1fU6-22wgVmwqd-P2hDrdEwEKJqFt-bi4bSHSSw=w300', 'market://details?id=com.freeappviet.apache.tajo', NULL, '', 0, 0),
