(293, 0, 0, 2, 'BOOKS_AND_REFERENCE', 0, 'Books & Reference', '19/2017', ' This tutorial has been designed for all those readers who depend heavily on MS-Excel to prepare charts, tables, and professional reports that involve complex data. It will help all those readers who use MS-Excel regularly to analyze data. Professionals who use data modeling and data analysis for reporting and decision-making purposes will benefit from this.PrerequisitesThis tutorial is an extension to Excel Power Pivot tutorial, hence it is a good idea to brush up on the Excel Power Pivot tutorial before you delve into DAX. Knowledge of Excel Functions and Excel Formulas is not necessary for this tutorial, as DAX is entirely for the Data Model in the Power Pivot window.   ', '', 1, '9/2017', 'com.freeappviet.excel.dax', 4.4, '//lh3.googleusercontent.com/jRiKs1_FJ8DKemUALmVs6rQ4ESyNk_hxxdogEc_1xE_EfBt-xyrrKKB8wL2g32qx4rUk=h310#//lh3.googleusercontent.com/GGqFibNkoGhDE2XJSFmat5ATKKkGszNN-xADpYF2Lo7ya4aHMY8emmV0EvXMfyAwzrwb=h310#//lh3.googleusercontent.com/ZPoqPdOU93maSyoP2ksTWqP97SoKUWCp8hYFtKlS1k7S52NhI_uy3lie9k0ifGFbH8WA=h310#//lh3.googleusercontent.com/IG4fsjnKSCIZuQMmkJ2AlcrT_EbNvo4I9X1NaV8yMeDurun_deX-C7LZ0kX7XSM_Pw=h310#//lh3.googleusercontent.com/ntohuBRk4HxEjvd1knCGy45v33lUO62dkzHmZdEkhZZ3evFV6EObQZ4LVVsPsAz_zKE=h310##', '4034047', 'Learn Excel DAX', 'learn excel dax', '1.0.1.1', '0', 'free.appviet', '//lh3.googleusercontent.com/yrRFclMZlDgNcBHJMH8RVOVQzXu2rAbQKOnfvsZ09KGggFgMUx7itnz_2G7R4KT91iE=w300', 'market://details?id=com.freeappviet.excel.dax', NULL, '', 0, 0),
(294, 0, 0, 2, 'BOOKS_AND_REFERENCE', 0, 'Books & Reference', '19/2017', ' This tutorial has been designed for all those readers who depend heavily on MS-Excel to prepare charts, tables, and professional reports that involve complex data. It will help all those readers who use MS-Excel regularly to analyze data.Once you get an understanding of the several Excel features that come handy in creating Excel dashboards, creating dashboards will become a trivial task for you.PrerequisitesBefore proceeding with this tutorial, the reader should have a preliminary understanding of Excel workbooks, Excel charts, Excel PivotTables, Excel Data Model, Excel Power PivotTables and Power PivotCharts and Excel Power View reports. All these topics are available as full-fledged tutorials in our tutorials library.   ', '', 1, '9/2017', 'com.freeappviet.excel.dashboards', 4.4, '//lh3.googleusercontent.com/0W7IVq0Mkgw0VYn6DzkgigexxQUz_GNHqyJFExjdw2l-tzg0OV2csEu5AgOb1UTyho0=h310#//lh3.googleusercontent.com/aKgpauGkq1MfVy4GUIKm0GoVYWGdWMGafXgLPiVwlpMJ1i-INyvNo4V6QTVRhthZj-k=h310#//lh3.googleusercontent.com/HCiwhglqH4xmoxp7_xDqQPAJYzrjrTjsZLrDAYOmXjjijj2LDd1UlPasidhA8xsL5A7O=h310#//lh3.googleusercontent.com/CcharjFASADfZkDYAd9OY-3kd-6ZGXbC_uCRXODPQ_puICM64uPH-ADe2RqNocQzPfKt=h310#//lh3.googleusercontent.com/Nds9NVbtevK1HXF6ZTtByIPhzImmIJJ2MBQoeqEYvYcTU8BdTJFw6rtXDStNkB3MqKyX=h310##', '4153666', 'Learn Excel Dashboards', 'learn excel dashboards', '1.0.1.1', '0', 'free.appviet', '//lh3.googleusercontent.com/skzvJphoAwIp6R9f4rZlokyNACLiJnVN6IOFhio-JDZ8U5eX40rk9PwTGwqyRD6jwuyS=w300', 'market://details?id=com.freeappviet.excel.dashboards', NULL, '', 0, 0),
(295, 0, 0, 2, 'BOOKS_AND_REFERENCE', 0, 'Books & Reference', '19/2017', ' This guide targets professionals with hands-on experience in Excel, to perform the highend data analysis and decision making in a matter of few minutes.PrerequisitesPower View is based on the Data Model in your workbook. Either you can start with a Data Model that is already available in Power Pivot or you can create a Data Model from Power View itself. In this tutorial, we assume that you are aware of the Data Model concepts in Power Pivot. Otherwise, we suggest you to go through our Excel Power Pivot tutorial first.   ', '', 1, '9/2017', 'com.freeappviet.excel.power.view', 4.4, '//lh3.googleusercontent.com/GJ1bZkIXonXbJ8TBUPsWAtyVsCGuR1g9wr2SOqAs3PK0KbIc5kWJdHlz-pW0zSYckQ=h310#//lh3.googleusercontent.com/D35PxYaT_2b28Ku337MqeX-3CXTGuahHeleoBJo6xxMZiUepHOI_2IGqzWGlSLKnV70=h310#//lh3.googleusercontent.com/iT9SxBF_fEmRpBe05hvDnpYuFttJhbU3Ok1SCuq13qRbDb_vFpi-milx0eivEKLIBxA=h310#//lh3.googleusercontent.com/PgYaUGdaEytGaB5yIHW_3WSgvu10zP5FpEqXMC78NeH-qrcvjYLWLoC-DlDyQT98wk0=h310#//lh3.googleusercontent.com/vsWv0-ptGjbkoXtQ4A812G73Wx6AIR-OYbPzm0gA9Kc0GQFx8yL7B3bboHtQHgWnEk2D=h310##', '4033660', 'Learn Excel Power View', 'learn excel power view', '1.0.1.1', '0', 'free.appviet', '//lh3.googleusercontent.com/Qs4xxR-7O3deNToO67-h25YCzD2AsJfWLGX98s924lh6bYaxbHDKuwtjC9bMJ59c7A=w300', 'market://details?id=com.freeappviet.excel.power.view', NULL, '', 0, 0),
(296, 0, 0, 2, 'BOOKS_AND_REFERENCE', 0, 'Books & Reference', '19/2017', ' This guide targets professional who have to track and analyze hundreds of thousands of data points with a compact table.This guide targets people who want to use tables or charts in presentations and help people understand data quickly. Whether you want to make a comparison, show a relationship, or highlight a trend, these tables help your audience “see” what you are talking about.PrerequisitesBefore you proceed with this tutorial, we are assuming that you are already aware of the basics of Microsoft Excel basics. If you are not well aware of these concepts, then we will suggest you to go through our short tutorials on Excel.   ', '', 1, '9/2017', 'com.freeappviet.excel.pivot.tables', 4.3, '//lh3.googleusercontent.com/rJGXaw-zjkUcPcDYuUuy7lWvbRAFURluvngdgyQ2qSmgDC-y_sb4E2_boeyP2f5M9Ls=h310#//lh3.googleusercontent.com/JsKEE1S82kou1KWF2jqCcg5tQ_JprebDli2dBKBlLr_MiXJLxbVApRkXoGoQF5B-Zis6=h310#//lh3.googleusercontent.com/TBxrJc7riH90Pxj5gKPIx8c0G5SCrBcQRIq8eoBC8KPGXRnU7_LH7B3y4mfYBorA3G_p=h310#//lh3.googleusercontent.com/rETuep4Ez1gHu87VX3OSsdClN0mu4Wofk9JU116lmX4NvwwM_2D9X3HfD6q83IQonAc=h310#//lh3.googleusercontent.com/BIH3oDRxqfFFh8WFBdgWh_gLj8TQUIMnjozj835zw57z7kWHuFcjOek2ptz_JyxAjFBQ=h310##', '3753302', 'Learn Excel Pivot Tables', 'learn excel pivot tables', '1.0.1.1', '0', 'free.appviet', '//lh3.googleusercontent.com/JJDxJm-3kwnI82DakM8nzunaLTzR3R3tBU4Uz7nMf0VSbgjwhtrMLMy5lA9t-WlFCA=w300', 'market://details?id=com.freeappviet.excel.pivot.tables', NULL, '', 0, 0),
(297, 0, 0, 2, 'BOOKS_AND_REFERENCE', 0, 'Books & Reference', '19/2017', ' This guide targets novice developers and those new to Excel Macros. After completing this tutorial, your firm foundation in creating macros will allow you to use macros efficiently.PrerequisitesWhen you record a macro, Excel stores it as a VBA code. You can view this code in the VBA editor. You can understand the code and modify it if you have substantial knowledge of Excel VBA. However, if you do not have sufficient knowledge, then we will suggest you to go through our short tutorials on VBA.   ', '', 1, '9/2017', 'com.freeappviet.excel.macros', 4.2, '//lh3.googleusercontent.com/j3_dGovvfTTdfqfr-v-lVghl1Yj9r-XObJ4biY3EKYrAi8PZN3FTHzHrLpTLtstnCw=h310#//lh3.googleusercontent.com/sC9LMXPCxJzj3GyGQ6BmsGzJNH4vQ0ym2UVFtr1dOz-mIlTuiJDbCgiH7g0urgtsZIs=h310#//lh3.googleusercontent.com/6K7z5-RzUPqM3gQri7tYIxyJxuewN1YABmlTw_n-_E5xK-Diw0cD83sm5Qz0RGuafQ=h310#//lh3.googleusercontent.com/Ny6qTCCZj6UK6V_q0mI1ze9m3hqcHcX2lRFhgGpzSQX9oiOSnFCuDYu7uyQSLvhZeQE=h310#//lh3.googleusercontent.com/PvdNsgTPr3vtJKvyWhkNaXmDh48wAWqhXusdjl7nAlmATRRwC7b0sNpyM7SinaNk0Rms=h310##', '4390218', 'Learn Excel Macros', 'learn excel macros', '1.0.1.1', '0', 'free.appviet', '//lh3.googleusercontent.com/tZDYelVYRsncjaKRUmiljXhKVcI9sdWKI4o80AvcL-sj2hwP8zdVI_oDGTpciZGkQw=w300', 'market://details?id=com.freeappviet.excel.macros', NULL, '', 0, 0),
