(429, 0, 0, 2, 'BOOKS_AND_REFERENCE', 0, 'Books & Reference', '10/2017', ' This tutorial is prepared for those professionals who aspire to learn the fundamentals as well as the refinements of CRO and implement it in practice. Conversion Rate Optimization is a system, which helps in increasing the percentage or the number of visitors on a website that further get converted into buyers/customers. In simpler terms, to make them take any desired action on that particular web page.This tutorial is proposed to make you comfortable in getting started with the basics of Conversion Rate Optimization and its other functions.PrerequisitesIt is a foundational tutorial for the beginners and they can easily understand the concepts explained here with basic knowledge of how a company or website deals with its conversion rate and how to further optimize it. However, it will help the learners, if they have some prior exposure to website handling along with some knowledge on conducting surveys and any other marketing and strategy techniques.   ', '', 1, '0/2017', 'com.freeappviet.conversion.rate.optimization', 4.4, '//lh3.googleusercontent.com/SD0ZTh8shTFAgYS_xF7ykPaEMyNMuw4lF4mYtUpk5iTTeg7YCRlxMuU1LvT0kC8XI7A=h310#//lh3.googleusercontent.com/mDaWdEj_0L59Zricd_2tqvslkTJRKOSEKK1XZSaPdimRHwx82hRADmieoPrczmzv4w=h310#//lh3.googleusercontent.com/rvPeZhIsH3RA5Su4zveh7bcc496yBWTZqL--AJpVOoTbPJQ6v7SmI3O-cpjLqbisk-o=h310#//lh3.googleusercontent.com/ZPREcqqp03fEVjcJN4cYdtMJYbn5dyvQMKmMKKyM3-6JXDvTTFqpGIPOC0YaSi2C7bk=h310#//lh3.googleusercontent.com/d6iM4RjfDCLl25aB88fpmbFiJg3BdhavtHQSWTmcTXF54MJX6caCB4qDHOO7NRlrc5Jf=h310##', '3666541', 'Learn Conversion Rate Optimization', 'learn conversion rate optimization', '1.0.1.1', '0', 'free.appviet', '//lh3.googleusercontent.com/Pe2EVacYO4JRp-XOtEpU9Cz9RQAt6Uyr-ePMzMkp6yh6wDehO5tiucmLswLcbtw24p4=w300', 'market://details?id=com.freeappviet.conversion.rate.optimization', NULL, '', 0, 0),
